import {React,Component} from 'react';
export default class Registration extends Component {
  constructor(props) {
      super(props);
      this.state = {
        message: ''
      };
    }
    onCreateEmployee=()=>{
      let empInfo={
            
            First_Name:this.refs.First_Name.value,
            Last_Name:this.refs.Last_Name.value,
            DOB:this.refs.DOB.value,
            Country:this.refs.Country.value,
            Nationality:this.refs.Nationality.value,
            Email:this.refs.Email.value,
            Alternate_Email:this.refs.Alternate_Email.value,
            Phone_no:this.refs.Phone_no.value,
            Password:this.refs.Password.value
            
          
      
          };
          fetch('https://localhost:44385/api/Registration/Create',{
      method: 'POST',
      headers:{'Content-type':'application/json'},
        body: JSON.stringify(empInfo)
    }).then(r=>r.json()).then(res=>{
      if(res){
        this.setState({message:'New Employee is Created Successfully'});
      }
    });
      }
    render(){
      return(
        <div>
          <center>
          <h2>Air Membership Registration</h2>
          </center>
          <p>
            <label>First_Name :<br /> <input type="text"  ref="First_Name"></input></label>
          </p>
          <p>
            <label>Last_Name :<br /> <input type="text" ref="Last_Name"></input></label>
          </p>
          <p>
            <label>DOB : <br /><input type="text" ref="DOB"></input></label>
          </p>
          <p>
            <label>Country : <input type="text" ref="Country"></input></label>
          </p>
          <p>
            <label>Nationality :<br /> <input type="text" ref="Nationality"></input></label>
          </p>
          <p>
            <label>Email :<br /> <input type="text" ref="Email"></input></label>
          </p>
          <p>
            <label>Alternate_Email : <br /><input type="text" ref="Alternate_Email"></input></label>
          </p>
          <p>
            <label>Phone_no : <input type="text" ref="Phone_no"></input></label>
          </p>
          <p>
            <label>Password :<br /> <input type="text" ref="Password"></input></label>
          </p>
          <center>
          <button type="button" class="btn btn-primary">Primary</button>
          <button >Create</button>
                
                <p>{this.state.message}</p>
                </center>
                </div>
      )
    }
  }
